INSERT INTO careplanner.residents (resident_external_id, resident_display_name, source_vendor, updated_at)
SELECT DISTINCT resident_external_id, resident_display_name, source_vendor, now()
FROM _stanley_staging
ON CONFLICT (source_vendor, resident_external_id) DO UPDATE SET
    resident_display_name = EXCLUDED.resident_display_name,
    updated_at = now();

INSERT INTO careplanner.staff_members (staff_external_id, staff_display_name, source_vendor, updated_at)
SELECT DISTINCT staff_external_id, staff_display_name, source_vendor, now()
FROM _stanley_staging
ON CONFLICT (source_vendor, staff_external_id) DO UPDATE SET
    staff_display_name = EXCLUDED.staff_display_name,
    updated_at = now();

INSERT INTO careplanner.note_categories (source_vendor, category_name)
SELECT DISTINCT source_vendor, category_name
FROM _stanley_staging
ON CONFLICT (source_vendor, category_name_normalized) DO UPDATE SET
    category_name = EXCLUDED.category_name;

INSERT INTO careplanner.daily_log_notes (
    note_id, note_version, resident_pk, staff_pk, category_pk, content, created_at_utc, event_timestamp,
    received_at, normalized_at, local_date, local_time, source_vendor, source_external_id, ingest_id,
    raw_payload_hash, raw_payload, updated_at
)
SELECT
    s.note_id,
    s.note_version,
    r.resident_pk,
    st.staff_pk,
    c.category_pk,
    s.content,
    s.created_at_utc,
    s.event_timestamp,
    s.received_at,
    s.normalized_at,
    s.local_date,
    s.local_time,
    s.source_vendor,
    s.source_external_id,
    s.ingest_id,
    s.raw_payload_hash,
    s.raw_payload,
    now()
FROM _stanley_staging s
JOIN careplanner.residents r
  ON r.source_vendor = s.source_vendor AND r.resident_external_id = s.resident_external_id
JOIN careplanner.staff_members st
  ON st.source_vendor = s.source_vendor AND st.staff_external_id = s.staff_external_id
JOIN careplanner.note_categories c
  ON c.source_vendor = s.source_vendor AND c.category_name_normalized = LOWER(btrim(s.category_name))
ON CONFLICT (source_vendor, source_external_id, note_version) DO UPDATE SET
    resident_pk = EXCLUDED.resident_pk,
    staff_pk = EXCLUDED.staff_pk,
    category_pk = EXCLUDED.category_pk,
    content = EXCLUDED.content,
    created_at_utc = EXCLUDED.created_at_utc,
    event_timestamp = EXCLUDED.event_timestamp,
    received_at = EXCLUDED.received_at,
    normalized_at = EXCLUDED.normalized_at,
    local_date = EXCLUDED.local_date,
    local_time = EXCLUDED.local_time,
    note_id = EXCLUDED.note_id,
    ingest_id = EXCLUDED.ingest_id,
    raw_payload_hash = EXCLUDED.raw_payload_hash,
    raw_payload = EXCLUDED.raw_payload,
    updated_at = now();

COMMIT;